const MainMenu = () => {
    return (
      <div className="main-menu">
        <h1>Welcome to the Main Menu</h1>
        <nav>
          <ul>
            <li><Link to="/home">Home</Link></li>
            <li><Link to="/about">About</Link></li>
            <li><Link to="/contact">Contact</Link></li>
          </ul>
        </nav>
      </div>
    );
  };

  export default MainMenu;
